    const getApiData =async ()=>{
         const res = await axios.get("https://picsum.photos/v2/list")
         const data = res.data
         setImages(data)
        //  console.log(data)
    }
useEffect(() => {
  getApiData()

 
}, [])


  return (
    <div className='photosApi'>
      {
        images.map((elem, id) =>{
          return    <div className="box" key={id}>
      <img src={elem.download_url}  alt=''/>
      <p>{elem.author}</p>
        </div>
        })
      }
    </div>
  )
}

